        <div onMouseEnter={()=>{ giver();}} className=" flex py-3 rounded-sm text-white font-integral text-xs transition-all duration-300 hover:text-black hover:bg-white">
      {props.name}
 {setter ? (<Submenu/>):<></>}
        </div>
    );
    }
  
     export default Navop;
